import "./App.css";
import img from "./assets/college_01.jpg";

function App() {
	return (
		<div className="App">
			<h1>Colleges in North India</h1>
			<div>
				<div>
					<img src={img}></img>
				</div>
			</div>
		</div>
	);
}

export default App;
